A very common use case is to compare two instants if A is before B or A is after B and so on.

As far as I could see this is neither implemented nor has an issue be opened for this so far.

The idea would be to extend the library to allow to do something like this

```
val a: Instant = ...
val b: Instant = ...

if (a.isBefore(b)) {
    // do something
}

if (a.isAfter(b)) {
     // do something else
}
```

